import React from 'react';

import {
  BrowserRouter as Router
} from 'react-router-dom';

import Routes from './routes/Routes';

import './assets/css/fonts.css';

function App() {
  return (
    <Router>
      <Routes />
    </Router>
  );
}

export default App;
